BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Provider" (
	"ProviderId"	INTEGER NOT NULL,
	"ProviderName"	TEXT,
	"ProviderUrl"	TEXT,
	PRIMARY KEY("ProviderId")
);
CREATE TABLE IF NOT EXISTS "PRODUCTS" (
	"ProductID"	INTEGER,
	"Name"	TEXT,
	"Price"	INTEGER,
	"ImageURL"	TEXT,
	"ProductURL"	TEXT,
	PRIMARY KEY("ProductID")
);
COMMIT;
